  true,\n\t\"url\": null,\n\t\"notes\": \"A list of regulations, orders, and guidance,
  including significant guidance - which include guidance document disseminated to
  regulated entities or the general public that may reasonably be anticipated to lead
  to an annual effect on the economy of $100 million or more or adversely affect in
  a material way the economy, a sector of the economy, productivity, competition,
  jobs, the environment, public health or safety, or State, local, or tribal governments
  or communities; create a serious inconsistency or otherwise interfere with an action
  taken or planned by another agency; materially alter the budgetary impact of entitlements,
  grants, user fees, or loan programs or the rights and obligations of recipients
  thereof; or raise novel legal or policy issues arising out of legal mandates, the
  President's priorities, or the principles set forth in Executive Order 12866, as
  further amended.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
